  function initPlayer(ysdk) {
    console.log(ysdk);
    ysdk.getPlayer().then(_player => {
      console.log('get player');

      // Игрок авторизован.
      playerGame = _player;
      let someTrue = false;
      let change = true;
      let offline = localStorage.getItem('offline');
      if(offline === '1'){
        offline = true;
        localStorage.setItem('offline', '0');
      } else{
        offline = false;
      }
      playerGame.getData(['allDoneWords', 'cantSaveData'], false).then((dataObject) => {
        if (dataObject.allDoneWords) {
          isRules = false;

          let newData = dataObject.allDoneWords;

          if(dataObject.cantSaveData){
            cantSaveData = true;
          }
          console.log(newData, dataObject.cantSaveData);
          if(typeof newData === "string"){
            newData = decompressData(newData);

            //Не получается сохранить сжатые данные на сервере
            if(!newData && dataObject.allDoneWords){
              console.log('cantSave');

              localStorage.setItem('cantSaveData', 'true');
              cantSaveData = true;

              playerGame.setData({
                allDoneWords: allDoneWords,
                cantSaveData: true
              }, false).then((ignored) => {});

              if(someTrue){
                update();
              }
              someTrue = true;
              return;
            }


          }
          newData = fixDoneWords(newData);
          console.log(newData);



          if(offline){
            const lastAllDoneWords = newData;
            let newWords, lastWords;
            newWords = Object.keys(allDoneWords).reduce((k, key)=> k + allDoneWords[key].length, 0);
            lastWords = Object.keys(lastAllDoneWords).reduce((k, key)=> k + lastAllDoneWords[key].length, 0);
            if(newWords > lastWords){
              change = false;
              tips = localStorage.getItem('tips');
              if(tips){
                tips = Number(tips);
              }else{
                tips = 3;
              }
              PLAYERSTATS = {
                tips: tips
              };
              setStats();
            }
          }

          PLAYESTATE = {allDoneWords: newData};
          recentState = JSON.stringify(PLAYESTATE);
          if(change){
            allDoneWords = newData;
            localStorage.setItem('allDoneWords', JSON.stringify(allDoneWords));
          }else{
            PLAYESTATE.allDoneWords = fixDoneWords(allDoneWords);
            recentState = JSON.stringify(PLAYESTATE);
            setState();
          }

        }  else{
          playerGame.setData({
            allDoneWords: compressData(allDoneWords)
          }, false).then((ignored) => {});
        }
        if(someTrue){
          update();
        }
        someTrue = true;
      }).catch((e) => {
        console.log(e);
        if(someTrue){
          update();
        }
        someTrue = true;
      });
      playerGame.getStats(['tips'], false).then((dataObject) => {
        if (dataObject.tips) {
          if(change){
            tips = dataObject.tips;
            PLAYERSTATS = dataObject;
            recentStats = JSON.stringify(PLAYERSTATS);
            localStorage.setItem('tips', tips);
          }
        }else{
          playerGame.setStats({
            tips: tips
          }, false).then((ignored) => {});
        }
        if(someTrue){
          update();
        }
        someTrue = true;
      }).catch((e) => {
        console.log(e);
        if(someTrue){
          update();
        }
        someTrue = true;
      });
      ysdk.getPayments({ signed: false }).then(_payments => {
        // Покупки доступны.
        payments = _payments;
        payments.getPurchases().then(purchases => purchases.forEach(consumePurchase));
      }).catch(err => {
        console.log(err);
      });
    }).catch((e) => {
      console.log(e);
      localStorage.setItem('offline', '1');
      doDeleteBlock = true;
      update();
    });
  }
  let TIPS = 0;
  let allTips = [20,50,100];
  function consumePurchase(purchase) {
    if (purchase.productID === 'cart_item2') TIPS = allTips[0];
    if (purchase.productID === 'cart_item3') TIPS = allTips[1];
    if (purchase.productID === 'cart_item4') TIPS = allTips[2];
    params({[purchase.productID]: 1});
    document.querySelector('.levels').dispatchEvent(new CustomEvent("buyTips"));
    payments.consumePurchase(purchase.purchaseToken);
  }
  function buyTips(item) {
    if(payments){
      let purchaseItem = 'cart_item' + item;
      payments.purchase(purchaseItem).then(purchase => {
        if(purchase.productID === purchaseItem){
          if(item === 2) TIPS = allTips[0]; //20
          if(item === 3) TIPS = allTips[1]; //50
          if(item === 4) TIPS = allTips[2]; //100
          let it = 'buy-' + item;
          params({[it]: 1});
